	render() {
		const { username, password } = this.state
		return (
			<div>
				<form onSubmit={this.submitHandler}>
					<div>
						<input
							type="text"
							name="username"
							value={username}
							onChange={this.changeHandler}
						/>
					</div>
					<div>
						<input
							type="text"
							name="password"
							value={password}
							onChange={this.changeHandler}
						/>
					</div>

					<button type="submit">Submit</button>
				</form>
			</div>
		)
	}
}

export default Logineeee
